import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Col, Container, Row } from "reactstrap";

// Import Background Image
import Img1 from "../assets/images/image-section-v2.png";

//import icon
import FeatherIcon from "feather-icons-react";

export default class About extends Component {
  render() {
    return (
      <React.Fragment>
        <section className="section" id="about">
          <Container>
            <Row className="justify-content-center">
              <Col lg={7}>
                <div className="text-center mb-5">
                  <h2 className="">About Us</h2>
                  <p className="text-muted">The mission is to provide premium, quality, and standard services. Our ambition is to shape our Support team to help your business take off. Every successful business focuses on excellence. We will demand the highest level of service for our clients. We are using the personal touch as a measurable benchmark, step by step, from project onset to website launch, to ensure we deliver the websiteâ€™s willingness to go above and beyond with the core. Dedication is the satisfaction of making a client comprehend the projectâ€™s vision.</p>
                </div>
              </Col>
            </Row>
            <Row>
              <Col lg={6}>
                <h2 className="mb-2 font-weight-normal display-5">VALUE EXCELS IN EVERYDAY DECISIONS</h2>
                <h2 className="font-weight-normal line-height-1_4 mb-4">We Bring You <span className="font-weight-medium">Simplicity</span></h2>
                <p className="text-muted mb-4">Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil atque corrupti molestiae.</p>
                <p className="f-17 text-muted"><FeatherIcon className="icon-xs text-primary icon-fill-primary icon mr-2" icon="grid" />Start Your Idea With Us</p>
                <p className="f-17 text-muted"><FeatherIcon className="icon-xs text-primary icon-fill-primary icon mr-2" icon="layout" /> Providing a solution</p>
                <p className="f-17 text-muted mb-4"><FeatherIcon className="icon-xs text-primary icon-fill-primary icon mr-2" icon="monitor" /> Launch your business</p>
                <Link to="#" className="read-more f-18">More Information <span className="ml-2 right-icon f-24">&#8594;</span></Link>
              </Col>
              <Col lg={6}>
                <div className="card border-0">
                  <div className="about-img my-5 ">
                  <img src={Img1} alt="" className="img-fluid d-block mx-auto" />
                  </div>
                </div>
              </Col>
            </Row>
          </Container>
        </section>
      </React.Fragment>
    );
  }
}
